import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const AboutContainer = styled(motion.div)`
  padding: 6rem 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const Hero = styled.div`
  text-align: center;
  margin-bottom: 5rem;

  h1 {
    font-size: clamp(2rem, 5vw, 3.5rem);
    color: ${props => props.theme.colors.text};
    margin-bottom: 1.5rem;
  }

  p {
    font-size: 1.25rem;
    color: ${props => props.theme.colors.lightText};
    max-width: 800px;
    margin: 0 auto;
    line-height: 1.6;
  }
`;

const Stats = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 3rem;
  margin: 5rem 0;
  text-align: center;

  h2 {
    font-size: 3rem;
    color: ${props => props.theme.colors.primary};
    margin-bottom: 1rem;
  }

  p {
    color: ${props => props.theme.colors.lightText};
    font-size: 1.1rem;
  }
`;

const TeamGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 3rem;
  margin-top: 4rem;
`;

const TeamMember = styled(motion.div)`
  text-align: center;

  h3 {
    color: ${props => props.theme.colors.text};
    font-size: 1.5rem;
    margin: 1.5rem 0 0.5rem;
  }

  p {
    color: ${props => props.theme.colors.lightText};
  }
`;

const TeamMemberImage = styled.img`
  width: 200px;
  height: 200px;
  border-radius: 50%;
  object-fit: cover;
  margin-bottom: 1.5rem;
  box-shadow: ${props => props.theme.shadows.medium};
  transition: ${props => props.theme.transitions.default};

  ${TeamMember}:hover & {
    transform: translateY(-5px);
    box-shadow: ${props => props.theme.shadows.large};
  }
`;

const About = () => {
  return (
    <AboutContainer
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <Hero>
        <h1>About Us</h1>
        <p>We're a team of passionate tech enthusiasts dedicated to transforming businesses through innovative IT solutions.</p>
      </Hero>

      <Stats>
        <div>
          <h2>200+</h2>
          <p>Projects Completed</p>
        </div>
        <div>
          <h2>50+</h2>
          <p>Team Members</p>
        </div>
        <div>
          <h2>15+</h2>
          <p>Years Experience</p>
        </div>
        <div>
          <h2>100%</h2>
          <p>Client Satisfaction</p>
        </div>
      </Stats>

      <h2>Our Team</h2>
      <TeamGrid>
        <TeamMember
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.1 }}
        >
          <TeamMemberImage src="/team/ceo.jpg" alt="CEO" />
          <h3>John Doe</h3>
          <p>CEO & Founder</p>
        </TeamMember>
        <TeamMember
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.2 }}
        >
          <TeamMemberImage src="/team/cto.jpg" alt="CTO" />
          <h3>Jane Smith</h3>
          <p>CTO</p>
        </TeamMember>
        <TeamMember
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.3 }}
        >
          <TeamMemberImage src="/team/lead-designer.jpg" alt="Lead Designer" />
          <h3>Mike Johnson</h3>
          <p>Lead Designer</p>
        </TeamMember>
        <TeamMember
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.4 }}
        >
          <TeamMemberImage src="/team/lead-developer.jpg" alt="Lead Developer" />
          <h3>Sarah Williams</h3>
          <p>Lead Developer</p>
        </TeamMember>
      </TeamGrid>
    </AboutContainer>
  );
};

export default About;
